    private String getPackageJsonFromDocumentPackage(DocumentPackage deserializedDocumentPackage) {
        Package serializedPackage = new DocumentPackageConverter(deserializedDocumentPackage).toAPIPackage();
        for ( Document document : deserializedDocumentPackage.getDocuments() ) {
            com.silanis.esl.api.model.Document apiDocument = new DocumentConverter(document).toAPIDocument(serializedPackage);
            serializedPackage.addDocument(apiDocument);
        }

        return Serialization.toJson(serializedPackage);
    }
